import React, { Component } from 'react'

class Project extends Component {
    render() {
        return (
            <div className="project">
                <a href="https://github.com/Wannee19/wannee19.github.io" target="_blank" rel="noopender noreferrer"><i class="fab fa-github"></i></a>
                <a href="https://www.linkedin.com/in/wannee-buason-401a55235/" target="_blank" rel="noopender noreferrer"><i class="fab fa-linkedin-in"></i></a>
            </div>
        );
    }
}

export default Project;
